    return(
        <div className="container mt-4 ">
        <div className="row">
            <div className="col-6 offset-3">
                <div className="card">
                    <h5 className="card-header">User Login</h5>
                    <div className="card"></div>

                </div>
           </div>
            </div>
        </div>
    );

}
export default Login;
